import {Await, NavLink} from '@remix-run/react';
import {Suspense} from 'react';
import {useRootLoaderData} from '~/root';
import AsteriskBorder from './AsteriskBorder';
import clockSvg from '~/assets/header/Clock.svg';
import knifeForkSvg from '~/assets/header/KnifeFork.svg';
import musicNoteSvg from '~/assets/header/Note.svg';
import phoneSvg from '~/assets/header/Phone.svg';
import WillBounce from './WillBounce';
/**
 * @param {HeaderProps}
 */
export function Header({header, settings, isLoggedIn, cart}) {
  const {shop, menu} = header;

  return (
    <header className="text-xl serif-font uppercase font-bold">
      {/* Desktop nav */}
      <div className='hidden md:block'>
        <div className='inset-0 absolute pointer-events-none z-10' style={{border: "18px solid var(--bg)"}}>
          <div className="ast-border m-[-1px] w-full h-full">
             <div className='w-full h-full' style={{border: "31px solid var(--bg)", position: "relative", zIndex: "-1"}}></div>
          </div>
        </div>
          <div className='fixed inset-x-1/2 whitespace-nowrap top-[20px] -translate-x-1/2 w-fit z-20'>
            <NavLink prefetch="intent" to="/" style={activeLinkStyle} end>
              <span className='rounded-outline font-sans uppercase italic font-bold text-[30px] bg-white block -translate-y-[2px] :focus:text-inherit bg-[var(--bg)]'>Baby Blues Luncheonette</span>
            </NavLink>          
          </div>
          <div className='fixed whitespace-nowrap bottom-[20px] right-[20px] w-fit z-20 pl-2  flex flex-col items-end'>
            <NavLink prefetch="intent" to="/contact" style={activeLinkStyle} end>
            <div className='flex flex-col items-end nav-link will-bounce'>
              <img src={settings.contact_icon.reference.image.url} alt="" className='bg-[var(--bg)]' />
              <div className='bg-[var(--bg)] '>
                <WillBounce text="Contact" />
              </div>
            </div>
            </NavLink>
          </div>
          <div className='fixed whitespace-nowrap top-[20px] right-[20px] pl-2 w-fit z-20  flex flex-col items-end'>
            <NavLink prefetch="intent" to="/menu" style={activeLinkStyle} end>
            <div className=' flex flex-col items-end nav-link will-bounce'>
              <img src={settings.menu_icon.reference.image.url} alt=""  className='bg-[var(--bg)]'/>
              <div className='bg-[var(--bg)]'>
                <WillBounce text="Menu" />
              </div>
            </div>

            </NavLink>
          </div>
          <div className='fixed whitespace-nowrap bottom-[20px] left-[20px] w-fit z-20 pr-2 nav-link will-bounce'>
            <NavLink prefetch="intent" to="/shop" style={activeLinkStyle} end>
            <img src={settings.shop_icon.reference.image.url} className='bg-[var(--bg)]' />
            <div className='bg-[var(--bg)]'>
              <WillBounce text="Shop" />
            </div>
            </NavLink>
          </div>
          <div className='fixed whitespace-nowrap top-[20px] left-[20px] w-fit z-20 pr-2 nav-link will-bounce'>
            <NavLink prefetch="intent" to="/hours" style={activeLinkStyle} end>
            <img src={settings.hours_icon.reference.image.url} alt=""  className='bg-[var(--bg)]'/>
            <div className='bg-[var(--bg)]'>
              <WillBounce text="Hours" />
            </div>
            </NavLink>
          </div>

      </div>          
      <div className='fixed whitespace-nowrap top-0 md:top-1/2 md:-translate-y-1/2 md:left-[20px] w-full md:w-fit z-20'>
        <HeaderCtas isLoggedIn={isLoggedIn} cart={cart} />
      </div>
      <div className='fixed whitespace-nowrap top-0 md:top-1/2 md:-translate-y-1/2 md:right-[20px] w-full md:w-fit z-20 hidden md:flex flex-col items-end'>
      <NavLink prefetch="intent" to="/press" style={activeLinkStyle} end>
        <div className='flex flex-col items-end nav-link will-bounce'>
          <img src={settings.press_icon.reference.image.url} alt="" style={{maxWidth: '45px'}}  className='bg-[var(--bg)]'/>
          <div className='bg-[var(--bg)]'>
            <WillBounce text="Press" />
          </div>
        </div>
      </NavLink>
      </div>
    </header>
  );
}

/**
 * @param {{
 *   menu: HeaderProps['header']['menu'];
 *   primaryDomainUrl: HeaderQuery['shop']['primaryDomain']['url'];
 *   viewport: Viewport;
 * }}
 */
export function HeaderMenu({menu, primaryDomainUrl, viewport}) {
  const {publicStoreDomain} = useRootLoaderData();
  const className = `header-menu-${viewport}`;

  function closeAside(event) {
    if (viewport === 'mobile') {
      event.preventDefault();
      window.location.href = event.currentTarget.href;
    }
  }

  return (
    <nav className={className} role="navigation">
      {(menu || FALLBACK_HEADER_MENU).items.map((item) => {
        if (!item.url) return null;

        // if the url is internal, we strip the domain
        const url =
          item.url.includes('myshopify.com') ||
          item.url.includes(publicStoreDomain) ||
          item.url.includes(primaryDomainUrl)
            ? new URL(item.url).pathname
            : item.url;
        return (
          <NavLink
            className="header-menu-item info"
            end
            key={item.id}
            onClick={closeAside}
            prefetch="intent"
            style={activeLinkStyle}
            to={url}
          >
            {item.title}
          </NavLink>
        );
      })}
    </nav>
  );
}

